import React from "react";
import "./index.scss";

class ProductCardFILTER extends React.Component {
  render() {
    return (
      <a href="/" className="productCardFILTER-Card">
        <img src={this.props.product.image} alt="" />
        <div className="productCardFILTER-Card-title">
          <img src={this.props.product.shop_badge_urls} alt="" />
          <p>{this.props.product.name}</p>
        </div>
        <p>{this.props.product.price_max}</p>
        <p>{this.props.product.final_price}</p>

        {/* <p>{this.props.product.}</p> */}
      </a>
    );
  }
}

export default ProductCardFILTER;
